    return (
        <div>
               <Hero hero="defaultHero">
                 <Banner title="luxious rooms" subtitle="delux rooms starting at $299">
                     <Link to="/rooms/"><button className="btn-primary">Our Roooms</button></Link>
                 </Banner>
               </Hero>
        </div>
    )
}
